import React from "react";
import Heading from "./Heading"
import Footer from "./Footer"
import Note from "./Note"
import ideas from "../ideas"

function App() {
    return <div>
        <Heading />
        <Footer />
        {ideas.map(idea =>(
             <Note 
                 key = {idea.key}
                 title = {idea.title}
                 content = {idea.content}
            />
        ))};
    </div>
};

export default App;
